INSERT INTO `page_contents` VALUES (1,1,'services','<div class=\"row mb40\">\r\n<div class=\"col-md-12 section-header text-center\">\r\n<h3 class=\"section-title underline\">Стоимость услуг</h3>\r\n</div>\r\n\r\n<div class=\"col-md-3 col-sm-6\">\r\n<div class=\"pricing-box\">\r\n<div class=\"pricing-head\"><span class=\"striked\" style=\"color: #f2f2f2\">привет)</span>\r\n\r\n<h2>Бесплатно</h2>\r\n\r\n<h6>Диагностика</h6>\r\n<i class=\"bg-icon fa fa-bar-chart\"></i></div>\r\n<!-- /.pricing-head -->\r\n\r\n<div class=\"pricing-foot\" style=\"border-top: #ff4b22 solid 3px\"><a class=\"contact-modal\" href=\"#contact-us\"><b>Заказать</b></a></div>\r\n<!-- /.pricing-foot --></div>\r\n<!-- /.pricing-box --></div>\r\n\r\n<div class=\"col-md-3 col-sm-6\">\r\n<div class=\"pricing-box\">\r\n<div class=\"pricing-head\"><span>от</span>\r\n\r\n<h2>₴ 1800</h2>\r\n\r\n<h6 class=\"inline-main\">Стандартный ремонт</h6>\r\n<i class=\"bg-icon fa fa-cog\"></i></div>\r\n<!-- /.pricing-head -->\r\n\r\n<div class=\"pricing-foot\" style=\"border-top: #ff4b22 solid 3px\"><a class=\"contact-modal\" href=\"#contact-us\"><b>Заказать</b></a></div>\r\n<!-- /.pricing-foot --></div>\r\n<!-- /.pricing-box --></div>\r\n<!-- /.col-sm-4 -->\r\n\r\n<div class=\"col-md-3 col-sm-6\">\r\n<div class=\"pricing-box\">\r\n<div class=\"pricing-head\"><span>от</span>\r\n\r\n<h2>₴ 2500</h2>\r\n\r\n<h6 class=\"inline-main\">Капитальное восстановление</h6>\r\n<i class=\"bg-icon fa fa-gears\"></i></div>\r\n<!-- /.pricing-head -->\r\n\r\n<div class=\"pricing-foot\" style=\"border-top: #ff4b22 solid 3px\"><a class=\"contact-modal\" href=\"#contact-us\"><b>Заказать</b></a></div>\r\n<!-- /.pricing-foot --></div>\r\n<!-- /.pricing-box --></div>\r\n<!-- /.col-sm-4 -->\r\n\r\n<div class=\"col-md-3 col-sm-6\">\r\n<div class=\"pricing-box\">\r\n<div class=\"pricing-head\"><span>от</span>\r\n\r\n<h2>₴ 250</h2>\r\n\r\n<h6>Ремонт сервопривода</h6>\r\n<i class=\"bg-icon fa fa-plug\"></i></div>\r\n<!-- /.pricing-head -->\r\n\r\n<div class=\"pricing-foot\" style=\"border-top: #ff4b22 solid 3px\"><a class=\"contact-modal\" href=\"#contact-us\"><b>Заказать</b></a></div>\r\n<!-- /.pricing-foot --></div>\r\n<!-- /.pricing-box --></div>\r\n<!-- /.col-sm-4 --></div>',NULL,'2019-10-01 18:49:07'),(2,1,'about_us','<div class=\"row\">\n<div class=\"col-md-12 section-header text-center\">\n<h3 class=\"section-title underline\">О нас</h3>\n</div>\n<!-- end section-header -->\n\n<div class=\"col-md-12 mb60 text-center\">\n<p>Наша компания успешно осваивает рынок по всей Украине. Сильные стороны сервиса Твин Турбо &ndash; надежность и скорость работы благодаря большому опыту мастеров и ремонту большого количество турбин! В практике ремонта разнообразные турбокомпрессоры, начиная от легковых заканчивая грузовыми и сельскохозяйственной техникой. Благодаря наличия современного оборудования включая в себе стенды по регулировки и балансировке происходит контроль качества произведенного ремонта. Гарантия на реставрированные турбины до 2 лет. Работаем с мелкими и крупными предприятиями</p>\n</div>\n<!-- end col-md-12 --></div>\n<!-- end row -->',NULL,'2019-09-30 09:27:04'),(3,2,'section_1','<div class=\"row\">\r\n<div class=\"col-md-12 section-header text-center\" style=\"margin-bottom: 20px\">\r\n<h3 class=\"section-title underline\">Сервопривод турбины</h3>\r\n</div>\r\n<!-- end section-header -->\r\n\r\n<p>Наша организация <b>&quot;TwinTurbo&quot;</b> производит диагностику, ремонт актуаторов Турбины &quot;Сервоприводов&quot; всех видов. Ремонтируем Сервопривода всех производителей - <b>Hella, Siemens VDO, Mahle</b> и другие. Гарантия на работы <b>2 года</b>. Диагностика <b>бесплатно</b>. Стоимость восстановления от 250 гривен. Ремонт сервопривода до 3‐х часов с использованием инновационного оборудования.</p>\r\n\r\n\r\n<div class=\"col-md-4 pb20\"><img alt=\"Ремонт Сервопривода Киев\" src=\"uploads/images/ремонт-сервопривода-червяки.jpg\" style=\"width: 100%\" /></div>\r\n\r\n<div class=\"col-md-8\">\r\n<p class=\"dropcap\" style=\"text-align: justify\">Большая часть современных автомобилей выпускается с турбированными двигателями, а тем временем турбины все чаще стали оснащать электронным актуатором &quot;Сервоприводом&quot;. Самая популярная поломка уже не механического типа, а поломка сервопривода &quot;электроного актуатора турбины&quot;. Что бы про диагностировать и отремонтировать сервопривод мы используем тестер-программатор нового поколения от Английского производителя TurboTechnics ATP-100, с его помощу, мы можем произвести диагностику сервопривода прям на автомобиле, не снимая турбины. Так же ATP100 имеет функцию программирования, с его помощью при необходимости мы сбрасываем настройки и выставляем базовые заводские.</p>\r\n</div>\r\n</div>',NULL,'2019-10-02 18:50:00'),(4,2,'section_2','            <div class=\"row\">\n                <div class=\"col-md-8\">\n                    <p class=\"dropcap\" style=\"text-align: justify\">\n                        Мы производим качественный ремонт акуаторов турбины \"Сервопривода\" - Hella, Siemens VDO, Mahle и т.д.\n\n                        После ремонта турбонагнетателя, мы производим отсройку саплового апарата \"Геометрии\" на спец.стенде.\n                        У нас имеется все необходимые элементы для восстановления вашего Сервопривода  червячный механизм, Сектора позиций, двигатель актуатора, электро платы(верхняя крышка), практически на все виды актуаторов, и большой список новых оригинальных Сервоприводов в сборе.\n\n                    </p>\n                </div>\n                <div class=\"col-md-4 pb20\">\n                    <img style=\"width: 100%\"\n                         src=\"/images/system/servoprivod/IMG_0894.jpg\"\n                         alt=\"Ремонт Сервопривода Киев\">\n                </div>\n            </div>',NULL,NULL),(5,3,'catalog_title','<h3 class=\"section-title underline\">Каталог турбин по маркам автомобилей</h3>',NULL,NULL),(6,3,'price_examples','            <div class=\"row\">\n                <div class=\"col-md-12 section-header text-center\" style=\"margin-bottom: 20px\">\n                    <h3 class=\"section-title underline\">Пример цен</h3>\n                </div> <!-- end section-header -->\n                <div class=\"col-md-10 col-md-offset-1\">\n                    <ol class=\"ol-style-4\">\n                        <li class=\"margin-list\">\n                            Новые оригинальные турбины - от 7000грн до 27000 грн\n                        </li>\n                        <li class=\"margin-list\">\n                            Новые китайские турбины - от 4500грн до 13000 грн\n                        </li>\n                        <li class=\"margin-list\">\n                            Реставрация турбины - от 5000грн до 8000 грн\n                        </li>\n                    </ol>\n                </div>\n            </div>',NULL,NULL),(7,4,'section_1','<div class=\"row\">\r\n<div class=\"col-md-12\">\r\n<div class=\"col-md-12 section-header text-center\">\r\n<h3 class=\"section-title underline\">Диагностика турбонагнетателя в Киеве TwinTurbo</h3>\r\n</div>\r\n<!-- end section-header --></div>\r\n\r\n<div class=\"col-md-12\">\r\n<h4 class=\"underline\">Где применяются турбины?</h4>\r\n\r\n<p class=\"dropcap section-text\">Автомобильные турбины применяются на дизельных и бензиновых моторах на большинство современных автомобилях. Режим турбо-наддува дает значительное прирост л.с. и при этом снижается потребление топлива. При не соблюдение правил Т.О., при долгой и интенсивной нагрузке происходит повреждение турбины, в последствие влекут за собой внушительные затраты на ремонт. Прежде всего перед восстановлением или заменой турбины на новую, необходимо произвести правильную диагностику, она укажет на причину выхода из строя турбонагнетателя, это поспособствует сберечь ваши сбережения и ваше время.</p>\r\n</div>\r\n<!-- end col-md-12 -->\r\n\r\n<div class=\"col-md-12 col-md-offset-5\">\r\n<h4 class=\"underline\">Диагностика турбокомпрессора</h4>\r\n</div>\r\n\r\n<div class=\"col-sm-5\"><img alt=\"Диагностика турбин в Киеве\" class=\"mb10\" src=\"uploads/images/twinTurbo-diagnostic-1.png\" style=\"width: 100%;\" /></div>\r\n\r\n<div class=\"col-sm-7\">\r\n<p class=\"section-text\">Диагностику произведем с визуального осмотра всей системы турбонаддува. В процессе специалист осматривает наличие масляных потёков, явных и механических дефектов, нагаров (просекания выхлопных газов) т.д.</p>\r\n\r\n<p>Диагностика турбин в 2х вариантах:</p>\r\n\r\n<div class=\"row\">\r\n<div class=\"col-md-12 col-sm-12\">\r\n<ol class=\"ol-style-3\">\r\n	<li>Без демонтажа, не посредственно на автомобиле.</li>\r\n	<li>С демонтажем турбонагнетателя и с проверкой на спец.стенде.</li>\r\n</ol>\r\n</div>\r\n<!-- end col-md-3 --></div>\r\n</div>\r\n\r\n<div class=\"col-md-12\">\r\n<p class=\"section-text\">Осмотр и диагностирование турбины без демонтажа позволит выявить присутствие осевого люфта и степень износа уплотнений и проверить наддув. Также без снятия турбины мастер проверят работа способность клапанов и элементы привода, управления турбины. В 55% случаях проблема ее появления и неисправность определяют при данном виде диагностики. Если визуально турбонагнетатель работает удовлетворительно, но проявляются признаки ее неисправности, тогда необходима снимать турбину и диагностировать на специальном стенде.</p>\r\n\r\n<p><strong style=\"color: black\">С помощью нужного оборудования специалисты проверяют и выясняют:</strong></p>\r\n\r\n<ul class=\"ul-style-2\">\r\n	<li><i class=\"fa fa-check list-icon\"></i>Из-за чего произошла утечка масла</li>\r\n	<li><i class=\"fa fa-check list-icon\"></i>Наличие дисбаланса</li>\r\n	<li><i class=\"fa fa-check list-icon\"></i>Уровень износа деталей турбины и пр</li>\r\n	<li><i class=\"fa fa-check list-icon\"></i>Правильность работы изменяемой геометрии турбонагнетателя</li>\r\n</ul>\r\n</div>\r\n</div>',NULL,'2019-09-30 19:34:02'),(8,4,'section_2','<div class=\"row\">\r\n<div class=\"col-md-12\">\r\n<div class=\"col-md-12 section-header text-center\">\r\n<h3 class=\"section-title underline\">Причины и признаки неисправности турбины</h3>\r\n</div>\r\n<!-- end section-header --></div>\r\n\r\n<div class=\"col-md-12\">\r\n<h4 class=\"underline\">Причиный неисправности турбины</h4>\r\n\r\n<p class=\"dropcap section-text\">Проверка турбины на стенде позволить обнаружить причину неисправности и провести соответствующий ремонт. Для корректной диагностики турбины мастер рекомендуют изначально проверить работу двигателя, топливной и электронной системы. Самые основные причины выхода из стоя турбины Неисправности турбо-наддува часто встречаются как у дизельных так и у бензиновых автомобилях.</p>\r\n</div>\r\n<!-- end col-md-12 -->\r\n\r\n<div class=\"col-sm-7\">\r\n<p><strong style=\"color: black\">Среди осиновых такие, как:</strong></p>\r\n\r\n<ul class=\"ul-style-2\">\r\n	<li><i class=\"fa fa-times list-icon\"></i>В масляной системе загрязнённое перепалённое масло двигателя (не своевременная замена, не качественное масло, и масляный фильтр)</li>\r\n	<li><i class=\"fa fa-times list-icon\"></i>Загрязненный воздух в системе наддува в трубопроводе</li>\r\n	<li><i class=\"fa fa-times list-icon\"></i>Перенасыщения воздуха в топливной системе (пере наддув)</li>\r\n	<li><i class=\"fa fa-times list-icon\"></i>Механические повреждения турбонагнетателя</li>\r\n	<li><i class=\"fa fa-times list-icon\"></i>Нарушения герметичности утечка воздушного потока</li>\r\n</ul>\r\n</div>\r\n\r\n<div class=\"col-sm-5\"><img alt=\"Диагностика турбин в Киеве\" class=\"mb10\" src=\"uploads/images/twinTurbo-diagnostic-2.jpg\" style=\"width: 100%;\" /></div>\r\n\r\n<div class=\"col-md-12\">\r\n<div class=\"col-md-12\">\r\n<h4 class=\"underline\">Признаки неисправности турбонагнетателя</h4>\r\n</div>\r\n<!-- end section-header -->\r\n\r\n<p class=\"section-text\">Как устройство турбонагнетатель весьма простой, компрессорное колесо движется при помощи ротора турбины которое раскручивается под давлением выхлопных газов, нагнетая воздух во впускной коллектор тем самым увеличивая мощность автомобиля. Система турбонаддува возможно увеличить номинальную мощность мотора от 30 до 47%.</p>\r\n</div>\r\n\r\n<div class=\"col-sm-5\"><img alt=\"Диагностика турбин в Киеве\" class=\"mb10\" src=\"uploads/images/twinTurbo-diagnostic-3.jpg\" style=\"width: 100%;\" /></div>\r\n\r\n<div class=\"col-sm-7\">\r\n<p><strong style=\"color: black\">О неисправности турбокомпрессора указывают такие основание:</strong></p>\r\n\r\n<ul class=\"ul-style-2\">\r\n	<li><i class=\"fa fa-times list-icon\"></i>Повышенный расход топлива</li>\r\n	<li><i class=\"fa fa-times list-icon\"></i>Резкая потеря тяги двигателя.</li>\r\n	<li><i class=\"fa fa-times list-icon\"></i>Белого сизого чёрного цвета дым из выхлопной системы</li>\r\n	<li><i class=\"fa fa-times list-icon\"></i>Повышенный расход масла в двигателе</li>\r\n</ul>\r\n\r\n<p class=\"section-text\">С появлением выше перечисленных признаков, необходимо произвести проверку турбонагнетателя для обнаружение причин неисправности. Эксплуатировать автомобиль с неисправной турбиной не желательно и опасно, т.к. может выйти из строя двигатель и другие не мало важные узлы и системы.</p>\r\n</div>\r\n</div>',NULL,'2019-09-30 19:35:16'),(9,5,'section_1','            <div class=\"row\">\n                <div class=\"col-md-4 pb20\">\n                    <img style=\"width: 100%\"\n                         src=\"uploads/images/wseries_r2b005797_large_6a149b199d0cee0f1852763cc89b501b76b32cb8.jpg\"\n                         alt=\"Ремонт турбин сельскохозяйственнной и спецтехники\">\n                </div>\n                <div class=\"col-md-8\">\n                    <p class=\"dropcap\" style=\"text-align: justify\">\n                        Турбосервис <b style=\"font-style: italic\">\"TwinTurbo\"</b> производит востоновление, профилактику\n                        турбонагнетателей всех видов \n                        спецтехники и сельскохозяйственной техники любого производителя.\n                        Когда турбонагнетатель выходит из строя, его почти всегда возможно отремонтировать, не прибегая\n                        к\n                        покупкам Б\\У или новой турбины.\n                        Наши мастера произведут точную диагностику вашей турбины, а так же работы по восстановлению,\n                        произведут замену неремонтопригодных элементов, соберут, отстроят, так же мы предоставляем\n                        большой\n                        выбор оригинального комплектующего.\n\n                        У нас есть филиалы в разных регионах, мы работаем по всей Украине, принимаем посылки по новой\n                        почте,\n                        авто люкс, ин тайм, а так же принимаем посылки передачи водителем рейсовым транспортом, для\n                        постоянных клиентов и партнеров действует система скидок.\n                    </p>\n                </div>\n            </div>',NULL,NULL),(10,5,'we_serve','<div class=\"row\">\r\n<div class=\"col-md-12 text-center\">\r\n<h3 class=\"section-title underline\">Наш сервис обслуживает</h3>\r\n</div>\r\n</div>\r\n\r\n<div class=\"row\">\r\n<div class=\"col-md-6\">\r\n<p class=\"p-main\" style=\"font-size: 18px\"><b>Техника:</b></p>\r\n\r\n<ul class=\"ul-style-2\" style=\"margin-bottom: 10px\">\r\n	<li><i class=\"fa fa-check list-icon li-icon\"></i>\r\n	<p class=\"li-p\">Трактора</p>\r\n	</li>\r\n	<li><i class=\"fa fa-check list-icon li-icon\"></i>\r\n	<p class=\"li-p\">Сеялки</p>\r\n	</li>\r\n	<li><i class=\"fa fa-check list-icon li-icon\"></i>\r\n	<p class=\"li-p\">Комбайны</p>\r\n	</li>\r\n	<li><i class=\"fa fa-check list-icon li-icon\"></i>\r\n	<p class=\"li-p\">Погрузчики</p>\r\n	</li>\r\n	<li><i class=\"fa fa-check list-icon li-icon\"></i>\r\n	<p class=\"li-p\">Подъёмники</p>\r\n	</li>\r\n	<li><i class=\"fa fa-check list-icon li-icon\"></i>\r\n	<p class=\"li-p\">Катки</p>\r\n	</li>\r\n	<li><i class=\"fa fa-check list-icon li-icon\"></i>\r\n	<p class=\"li-p\">Тягачи</p>\r\n	</li>\r\n	<li><i class=\"fa fa-check list-icon li-icon\"></i>\r\n	<p class=\"li-p\">Бульдозеры</p>\r\n	</li>\r\n	<li><i class=\"fa fa-check list-icon li-icon\"></i>\r\n	<p class=\"li-p\">И другие</p>\r\n	</li>\r\n</ul>\r\n</div>\r\n\r\n<div class=\"col-md-6\">\r\n<p class=\"p-main\" style=\"font-size: 18px\"><b>Марки техники:</b></p>\r\n\r\n<ul class=\"ul-style-2\" style=\"margin-bottom: 10px\">\r\n	<li><i class=\"fa fa-check list-icon li-icon\"></i>\r\n	<p class=\"li-p\">John Deere</p>\r\n	</li>\r\n	<li><i class=\"fa fa-check list-icon li-icon\"></i>\r\n	<p class=\"li-p\">Caterpillar</p>\r\n	</li>\r\n	<li><i class=\"fa fa-check list-icon li-icon\"></i>\r\n	<p class=\"li-p\">Borg Warner</p>\r\n	</li>\r\n	<li><i class=\"fa fa-check list-icon li-icon\"></i>\r\n	<p class=\"li-p\">Garett</p>\r\n	</li>\r\n	<li><i class=\"fa fa-check list-icon li-icon\"></i>\r\n	<p class=\"li-p\">Liebherr</p>\r\n	</li>\r\n	<li><i class=\"fa fa-check list-icon li-icon\"></i>\r\n	<p class=\"li-p\">deutz fahrins</p>\r\n	</li>\r\n	<li><i class=\"fa fa-check list-icon li-icon\"></i>\r\n	<p class=\"li-p\">New Holland</p>\r\n	</li>\r\n	<li><i class=\"fa fa-check list-icon li-icon\"></i>\r\n	<p class=\"li-p\">И другие</p>\r\n	</li>\r\n</ul>\r\n</div>\r\n</div>',NULL,'2019-10-01 12:49:36'),(11,6,'section_1','<div class=\"row\">\r\n                <div class=\"col-md-12\">\r\n                    <p class=\"dropcap section-text\" style=\"text-align: justify\">\r\n                        Наши мастера <b style=\"font-style: italic\">\"TwinTurbo\"</b> смогу произвести демонтаж — монтаж\r\n                        турбонагнетателя с вашего автомобиля.\r\n                        При обнаружении выхода из строя турбокомпрессора, возникает вопрос о его снятие, это может бить\r\n                        для проведения осмотра, профилактики, либо же ремонта, в редких случаях приходится покупать\r\n                        новый.\r\n                        Замена турбины это трудоемкий процесс, и его должны проводить в специализированных местах,\r\n                        квалифицированные специалисты.\r\n\r\n                    </p>\r\n                </div> <!-- end col-md-12 -->\r\n                <div class=\"col-md-12 col-md-offset-5\">\r\n                    <h4 class=\"underline\">И так, как же все таки её демонтировать?</h4>\r\n                </div>\r\n                <div class=\"col-md-5 pb20\">\r\n                    <img style=\"width: 100%\"\r\n                         src=\"uploads/images/montage-domntage-1.png\"\r\n                         alt=\"Снятие - установка турбины\">\r\n                </div>\r\n                <div class=\"col-md-7\">\r\n                    <div class=\"timeline\">\r\n                        <div class=\"timeline-row\">\r\n                            <div class=\"tm-icon\">\r\n                                <span class=\"fa fa-bolt\"></span>\r\n                            </div>\r\n                            <div class=\"tm-detail\">\r\n                                <h5 class=\"mb10\">Шаг 1</h5>\r\n                                <p class=\"section-text\">\r\n                                    Производят обесточивание автомобиля, и обеспечивают себе доступ к ней.\r\n                                    В процессе демонтажа может понадобится, снять аккумулятор,\r\n                                    катализатор, стартер либо генератор, и прочий узлы по необходимости, так\r\n                                    же есть автомобили на которых приходиться вывешивать \"двигатель с\r\n                                    коробкой передач\" плоть до того — что нужно отделять кузов автомобиля от\r\n                                    рамы.\r\n                                </p>\r\n                            </div> <!-- end tm-detail -->\r\n                        </div> <!-- end timeline-row -->\r\n                        <div class=\"timeline-row\">\r\n                            <div class=\"tm-icon\">\r\n                                <span class=\"fa fa-dashboard\"></span>\r\n                            </div>\r\n                            <div class=\"tm-detail\">\r\n                                <h5 class=\"mb10\">Шаг 2</h5>\r\n                                <p class=\"section-text\">Отключение датчиков турбонагнетателя, отсоединение всех\r\n                                    патрубков —\r\n                                    вакуумных, масло слива, подачи.</p>\r\n                            </div> <!-- end tm-detail -->\r\n                        </div> <!-- end timeline-row -->\r\n                        <div class=\"timeline-row\">\r\n                            <div class=\"tm-icon\">\r\n                                <span class=\"fa fa-wrench\"></span>\r\n                            </div>\r\n                            <div class=\"tm-detail\">\r\n                                <h5 class=\"mb10\">Шаг 3</h5>\r\n                                <p class=\"section-text\">Как правило, снятие турбонагнетатель начинается со стороны\r\n                                    выхлопной\r\n                                    системы откручивают трубу, так же это может быть — катализатор или\r\n                                    сажевый фильтр которые прилегает к горячей части турбокомпрессора,\r\n                                    сохраняем все уплотнители, болты, гайки, шпильки для дальнейшего подбора\r\n                                    и замены на новые.</p>\r\n                            </div> <!-- end tm-detail -->\r\n                        </div> <!-- end timeline-row -->\r\n                        <div class=\"timeline-row\">\r\n                            <div class=\"tm-icon\">\r\n                                <span class=\"fa fa-cog\"></span>\r\n                            </div>\r\n                            <div class=\"tm-detail\">\r\n                                <h5 class=\"mb10\">Шаг 4</h5>\r\n                                <p class=\"section-text\">После мастер снимает верхний патрубки, если нужно он откручивает\r\n                                    его от\r\n                                    крепежей, после уже переходит не посредство к турбонагнетателю,\r\n                                    большинство турбин можно снять без выпускного коллектора, ну мы\r\n                                    рекомендуем всегда снимать и выпускной коллектор да бы удостоверится о\r\n                                    его техническом состояние.\r\n                                    Готово: далее происходит диагностика и ремонт турбонагнетателя.\r\n                                </p>\r\n                            </div> <!-- end tm-detail -->\r\n                        </div> <!-- end timeline-row -->\r\n                    </div> <!-- end timeline -->\r\n                </div>\r\n                <div class=\"col-md-12\">\r\n                    <h4 class=\"underline\">Квалифицированный монтаж турбонагнетателя</h4>\r\n                    <p class=\"section-text\">\r\n                        На деле снятие — установка турбины означает, произвести действия, о которых мы писали выше, но\r\n                        все в обратной последовательности. Но как говорится — ломать не стоить. На практике монтаж\r\n                        турбины занимает больше времени.\r\n                    </p>\r\n                </div>\r\n                <div class=\"col-md-12\">\r\n                    <h4 class=\"underline\">Правила установки</h4>\r\n                </div>\r\n                <div class=\"col-md-7\">\r\n                    <div class=\"timeline\">\r\n                        <div class=\"timeline-row\">\r\n                            <div class=\"tm-icon\">\r\n                                <span class=\"fa fa-cogs\"></span>\r\n                            </div>\r\n                            <div class=\"tm-detail\">\r\n                                <h5 class=\"mb10\">Шаг 1</h5>\r\n                                <p class=\"section-text\">\r\n                                    Проверяем все комплектующие, убеждаемся что патрубок подачи масло с достаточной\r\n                                    пропускной\r\n                                    способностью, меняем все уплотнители, гайки, шпильки, болты и хомуты на новые,\r\n                                    старые\r\n                                    элементы не подлежат вторичному использованию.\r\n                                </p>\r\n                            </div> <!-- end tm-detail -->\r\n                        </div> <!-- end timeline-row -->\r\n                        <div class=\"timeline-row\">\r\n                            <div class=\"tm-icon\">\r\n                                <span class=\"fa fa-circle-o\"></span>\r\n                            </div>\r\n                            <div class=\"tm-detail\">\r\n                                <h5 class=\"mb10\">Шаг 2</h5>\r\n                                <p class=\"section-text\">Нужно совместить все отверстия, если же соединение фланцевые</p>\r\n                            </div> <!-- end tm-detail -->\r\n                        </div> <!-- end timeline-row -->\r\n                        <div class=\"timeline-row\">\r\n                            <div class=\"tm-icon\">\r\n                                <span class=\"fa fa-check-circle-o\"></span>\r\n                            </div>\r\n                            <div class=\"tm-detail\">\r\n                                <h5 class=\"mb10\">Шаг 3</h5>\r\n                                <p class=\"section-text\">После установки нужно вернуть все ранее снятые для удобства\r\n                                    оборудование на место.</p>\r\n                            </div> <!-- end tm-detail -->\r\n                        </div> <!-- end timeline-row -->\r\n                        <div class=\"timeline-row\">\r\n                            <div class=\"tm-icon\">\r\n                                <span class=\"fa fa-plug\"></span>\r\n                            </div>\r\n                            <div class=\"tm-detail\">\r\n                                <h5 class=\"mb10\">Шаг 4</h5>\r\n                                <p class=\"section-text\">Подключить все датчики и шланги. Далее пробный запуск двигателя,\r\n                                    ждем несколько минут на\r\n                                    холостых оборотах, увеличиваем обороты до 3500 тыс. в минуту и держим педаль\r\n                                    акселератор\r\n                                    газа на протяжение 2‐х минут, если же нет посторонних шумов, белого сизого и черного\r\n                                    дыма и\r\n                                    прочих моментов — все в порядке.\r\n                                </p>\r\n                            </div> <!-- end tm-detail -->\r\n                        </div> <!-- end timeline-row -->\r\n                    </div> <!-- end timeline --> <!-- end timeline -->\r\n                </div>\r\n                <div class=\"col-md-5 pb20\">\r\n                    <img style=\"width: 100%\"\r\n                         src=\"uploads/images/montage-domntage-2.jpg\"\r\n                         alt=\"Снятие - установка турбины\">\r\n                </div>\r\n            </div>\r\n            <div class=\"col-md-12\">\r\n                <h4 class=\"underline\">Возможно самому произвести демонтаж-монтаж турбонагнетателя?</h4>\r\n                <p class=\"section-text\">\r\n                    Да можно, теоретически это легко, а на практике это очень трудоемкий процесс.\r\n                    Самостоятельное снятие — это определенный риск сделать что-то не так, лишние траты времени, и лишние нервы.\r\n\r\n                </p>\r\n            </div>',NULL,'2019-10-01 08:18:06'),(12,7,'section_1','<div class=\"row\">\r\n<div class=\"col-md-12 section-header text-center\" style=\"margin-bottom: 20px\">\r\n<h3 class=\"section-title underline\">Стоимость услуг</h3>\r\n</div>\r\n<!-- end section-header -->\r\n\r\n<div class=\"col-md-10 col-md-offset-1\">\r\n<table class=\"table table-hover\" style=\"margin-bottom: 30px\">\r\n	<thead>\r\n		<tr>\r\n			<th>Название услуги</th>\r\n			<th>Стоимость (грн)</th>\r\n		</tr>\r\n	</thead>\r\n	<tbody>\r\n		<tr>\r\n			<td>Стандартный ремонт</td>\r\n			<td>от 1490</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Капитальный ремонт</td>\r\n			<td>от 2490</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Замена картриджа</td>\r\n			<td>550</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Замена картриджа</td>\r\n			<td>550</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Замена геометрии</td>\r\n			<td>400</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Чистка горячей и холодной части турбонагнетателя</td>\r\n			<td>250</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Чистка и раскоксовка масляно впускной системы</td>\r\n			<td>от 300</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Демонтаж - монтаж турбокомпрессора с автомобиля</td>\r\n			<td>от 1000</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Диагностика электронного актуатора</td>\r\n			<td><strong style=\"font-style: italic; color: #787878\">Бесплатно</strong></td>\r\n		</tr>\r\n		<tr>\r\n			<td>Демонтаж - монтаж и регулировка вакуумного актуатора</td>\r\n			<td>от 450</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Ремонт электронного актуатора</td>\r\n			<td>от 1500</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Настройка актуатора с потенциометром Ford Kuga, Mondeo</td>\r\n			<td>1500</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n</div>\r\n</div>\r\n\r\n<p><img alt=\"TwinTurbo ремонт и продажа турбин\" src=\"uploads/images/price-list-hr.jpg\" style=\"width: 100%;\" /></p>\r\n\r\n<div class=\"mb-40\">\r\n<p class=\"p-main underline\">Диагностика турбокомпрессора - <b style=\"font-style: italic\">бесплатно</b></p>\r\n\r\n<p class=\"p-abzac\">Вы можете приехать к нам на осмотр турбины не снимая его с автомобиля, наши специалисты проведу визуальную и компьютерную диагностику турбонагнетателя, скажут вам свой вердикт.</p>\r\n</div>\r\n\r\n<div class=\"mb-40\">\r\n<p class=\"p-main underline\">Стандартный ремонт - от 1490 грн</p>\r\n\r\n<p class=\"p-abzac\">Разборка, дефиктовка, замена внутреннего набора (Упорный подшипник, радиальный подшипник скольжения, два газомасляных уплотнения, дистанционная шайба, катушка), вал и компрессорное колесо остается клиента.</p>\r\n</div>\r\n\r\n<div class=\"mb-40\">\r\n<p class=\"p-main underline\">Капитальный ремонт - от 2490 грн</p>\r\n\r\n<p class=\"p-abzac\">Происходит те же роботы что и в стандартном + смена компрессорного колеса с валом, остается только центральный корпус, холодная и горячая коллектор турбины.</p>\r\n</div>\r\n\r\n<div class=\"mb-40\">\r\n<p class=\"p-main underline\">Замена картриджа - 550 грн</p>\r\n\r\n<p class=\"p-abzac\">Самый быстрый и самый надежный способ восстановления турбины, потому что катридж приходит с завода отбалансированный, с заводскими параметрами.</p>\r\n</div>\r\n\r\n<div class=\"mb-40\">\r\n<p class=\"p-main underline\">Замена геометрии - 400 грн</p>\r\n\r\n<p class=\"p-abzac\">По нашей практике каждая 10 геометрия подлежит к смене на новую, так как горят лопатки соплового апарата, или же в них что то прилетает и они попросту меняют свою форму (гнуться).</p>\r\n</div>\r\n\r\n<div class=\"mb-40\">\r\n<p class=\"p-main underline\">Ремонт электронного актуатора (сервопривода) - от 1500 грн</p>\r\n\r\n<p class=\"p-abzac\">Мы занимаемся восстановлением сервоприводов таких производителей как Simens VDO, Hella, Mahle т.д. Производим смену элементов который вышли из стоя - червяк (шнек), полумесяц ( Сектор - позиции), шоколадку ( электро плата ), моторчик . Так же прогромация сервопривода на самом современном-оборудование VTR100, и в сборе с турбонагнетателем и проверяем на стенде.</p>\r\n</div>\r\n\r\n<div class=\"text-center\">\r\n<p class=\"p-main\" style=\"color: black;\"><b>Стоимость нового турбонагнетателя всегда выше, а стоимость восстановления составляет от 30 до 50% цены новой турбины.</b> Так же мы говорим полную стоимость восстановления сразу после (бесплатной) диагностики, без скрытых платежей. Если же у вас проблема с турбонагнетателем, вы можете набрать нас по телефону или оставить заявку на сайте, и мы вам перезвоним.</p>\r\n</div>',NULL,'2019-10-01 13:05:56'),(13,7,'section_2','<div></div>',NULL,'2019-10-01 13:04:52'),(14,8,'section_1','            <div class=\"row\">\n                <div class=\"col-md-12 text-center\">\n                    <h3 class=\"section-title underline\">Неправильная установка турбины</h3>\n                </div>\n                <p>\n                    Для того что бы турбокомпрессор проработал достаточно долго, его нужно правильно установить. Не\n                    соблюдая инструкций монтажа может привести к повреждение самого узла и при этом сократить срок\n                    эксплуатации.\n                </p>\n                <p><strong style=\"color: black\">11 ошибок монтажа турбины, при которых отменяются гарантийные\n                        условия:</strong></p>\n                <ul class=\"ul-style-2\">\n                    <li><i class=\"fa fa-times list-icon\"></i>Масляное голодание, проявляется плохой пропускной способностью трубки масло подачи в турбонагнетатель.\n                    </li>\n                    <li><i class=\"fa fa-times list-icon\"></i>Загрязненный воздух в системе наддува в трубопроводе</li>\n                    <li><i class=\"fa fa-times list-icon\"></i>Попадание инородного тела в турбину(со стороны наддува по холодной части, или же по горячей части со стороны выпускного коллектора).\n                    </li>\n                    <li><i class=\"fa fa-times list-icon\"></i>Вмешательство в турбокомпрессор, самостоятельная, разборка, сборка, настройка - сервопривода,геометрии или вакуумного актуатора, изменения поворотов корпусов турбонагнетателя.</li>\n                    <li><i class=\"fa fa-times list-icon\"></i>Подпор картерных газов со стороны выхлопной системы, следствия забитый катализатор - сажевый фильтр.</li>\n                    <li><i class=\"fa fa-times list-icon\"></i>Перелив форсунок дизельного топлива, в следствие догорает топливо в выпускной системе при этом оплавляет лопатки вала, дополнительно происходит перегрев системы, перегревается и клинет сопловой аппарат (геометрия) т.д.</li>\n                    <li><i class=\"fa fa-times list-icon\"></i>Использование не качественного масла, которое не подходит по допускам к вашему автомобилю, добавление присадок, смешивание разных масел,  что может привести к обрыву ротора - который происходит в результате проникновения абразивных веществ.</li>\n                    <li><i class=\"fa fa-times list-icon\"></i>Не соблюдения правил Т.О. - перепробег по маслу, не регулярная замена фильтров.</li>\n                    <li><i class=\"fa fa-times list-icon\"></i>Использование герметика во время монтажа турбокомпрессора.</li>\n                    <li><i class=\"fa fa-times list-icon\"></i>Не исправность сапуна (дыхательный клапан) - с  его помощью сбрасывается избыточное давление, которое образуется в внутри двигателя, (превышение - 4.5кгс|см2 или ниже 1.2 кгс|см2)</li>\n                    <li><i class=\"fa fa-times list-icon\"></i>Установка турбокомпрессора на авто который глохнет на холостых оборотах.</li>\n                </ul>\n            </div>',NULL,NULL),(15,9,'section_1','            <div class=\"row\">\n                <div class=\"col-md-12 text-center\">\n                    <h3 class=\"section-title underline\">Признаки неисправности турбины</h3>\n                </div>\n                <p><strong style=\"color: black\">Есть ряд признаков о не правильной работе турбонагнетателя,\n                        7 основных симптомов - например:\n                    </strong></p>\n                <ul class=\"ul-style-2\">\n                    <li><i class=\"fa fa-times list-icon\"></i>Повышеное потребления масла в двигателя\n                    </li>\n                    <li><i class=\"fa fa-times list-icon\"></i>Появления масляных потёков, по системе наддува,\n                        либо на самой турбине\n                    </li>\n                    <li><i class=\"fa fa-times list-icon\"></i>Увеличелся расход топлива\n                    </li>\n                    <li><i class=\"fa fa-times list-icon\"></i>Резкий провал мощности мотора</li>\n                    <li><i class=\"fa fa-times list-icon\"></i>Появления дыма с выхлопной системы - белого, чёрного, сизого.</li>\n                    <li><i class=\"fa fa-times list-icon\"></i>Изменение в динамике набора скорости.</li>\n                    <li><i class=\"fa fa-times list-icon\"></i>Появление шума, похож на свист, скрежет, при повышение оборотов.</li>\n                </ul>\n            </div>\n            <p>Тогда вам нужно подъехать в автомобильный сервис, для диагностики, в процессе вам следуем проверить двигатель, систему наддува, все патрубки, и сам турбокомпрессор, если же диагностирование покажет что турбина вышла их стоя, вы можете снять её у нас, либо на любом другом сервисе, и привезти её к нам на диагностику для проявления причин выхода из строя, после мы произведем подходящий ремонт вашего турбокомпрессора после всех выполненных робот вы получите уже работающий турбонагнетатель и гарантию до 2х лет.\n                Так же если вы делаете капитальный ремонт двигателя, вам следует произвести проверку вашей турбины.\n            </p>\n            <p><strong style=\"color: black\">Мы производи диагностику в 3 этапа:\n                </strong></p>\n            <ol class=\"ol-style-4\">\n                <li class=\"margin-list\">1 визуальный осмотр\n                </li>\n                <li class=\"margin-list\">при необходимости проверка на стенде\n                </li>\n                <li class=\"margin-list\">полная разборка и осмотр всех внутренних элементов турбокомпрессора\n                </li>\n            </ol>\n            <p><strong style=\"color: black\">У нас в команде мастера с опытом более 10 лет ремонта турбонагнетателей.\n                </strong></p>',NULL,NULL),(16,10,'section_1','<div class=\"row\">\n                <div class=\"col-md-12 text-center\">\n                    <h3 class=\"section-title underline\">Принцип роботы, причины из-за которых может произойти поломка вашей турбины.</h3>\n                </div>\n                <p>Ни одна деталь в  Турбокомпрессоре не трется друг об друга, они скользят под давление, из-за этого турбина не имеет практически выработки, и её срок службы может достигать 10-15 лет, конечно же при правильном обслуживание автомобиля.</p>\n                <p><strong style=\"color: black\">Есть всего 3 главных фактора поломки турбокомпрессора:\n                    </strong></p>\n                <ul class=\"ul-style-2\">\n                    <li><i class=\"fa fa-times list-icon\"></i>Загрязненный поток воздуха в системе наддува (плохо фильтрованный), из-за происходит выработка по компрессорному колесу, турбина уходит в дисбаланс - происходит повышение вибрации в процессе оборотов  и ломается ротор.\n                    </li>\n                    <li><i class=\"fa fa-times list-icon\"></i>Оригинальное масло в двигатель должно быть очень хорошего качества, топовых производителей, и соответствовать допускам под ваш автомобиль - которые устанавливает завод изготовитель, очень часто люди сталкиваются с поделками, по этому важно покупать масло в проверенном место, так же использование разных присадок пагубно влияет на работоспособность турбокомпрессор.\n                    </li>\n                    <li><i class=\"fa fa-times list-icon\"></i>Еще не мало важную роль отыгрывает дизельное топливо, но конечно же с комплексе с правильной работы топливного оборудование на авто, чрезмерный перелив топлива в цилиндры, несгоревшее топливо догорает в выпускном коллекторе, крыльчатке вала - тем самым оплавляя её, так же без внимание не остается сопловой аппарат (геометрия турбокомпрессора) от сгорания топлива в турбине, перегревается геометрия и она начинает клинить.\n                    </li>\n\n                </ul>\n            </div>',NULL,NULL),(17,11,'section_1','<div class=\"row\">\r\n<div class=\"col-md-12\">\r\n<div class=\"col-md-12 section-header text-center\">\r\n<h3 class=\"section-title underline\">Актуатор турбины он же клапан Вестгейта - один из элементов турбины который контролирует давление нагнетаемого воздуха.</h3>\r\n</div>\r\n<!-- end section-header --></div>\r\n\r\n<p><strong style=\"color: black\">Существует 3 вида актуаторов: </strong></p>\r\n\r\n<ul class=\"ul-style-2\">\r\n	<li><i class=\"fa fa-check list-icon\"></i>Вакуумный</li>\r\n	<li><i class=\"fa fa-check list-icon\"></i>Электровакуумный</li>\r\n	<li><i class=\"fa fa-check list-icon\"></i>Электронный (Сервопривод)</li>\r\n</ul>\r\n\r\n<p class=\"dropcap\">Но в данной статье мы поговорим про Вакуумный. В 80% случаев актуатор - выходит из строя из-за не корректной работы турбокомпрессора, а 20% попросту исчерпания своего ресурса, определить что сломан актуатор вы самостоятельно не сможете, для этого нужно специальное оборудование, но поскольку турбина уже будет работать не корректно, вы сможете понять это по нескольким факторам, ухудшение динамики автомобиля, либо будут мигать индикаторы на приборной панели. А еще Вакуумный и Электровакуумный актуатор есть в двух исполнениях (Нажимной и Всасывающийся).</p>\r\n\r\n<div class=\"col-md-12 col-md-offset-5\">\r\n<h4 class=\"underline\">Принцип его работы</h4>\r\n</div>\r\n\r\n<div class=\"col-sm-5\"><img alt=\"типы актуаторов\" class=\"mb10\" src=\"https://via.placeholder.com/600x300\" width=\"100%\" /></div>\r\n\r\n<div class=\"col-sm-7\">\r\n<div class=\"row\">\r\n<div class=\"col-md-12\">\r\n<ol class=\"ol-style-4\">\r\n	<li class=\"margin-list\">Выхлопные газы, выходят с выпускного коллектора проходя через чугунную часть турбины(горячую), создавая нужный поток газов приводя раскручивая при это крыльчатку и она начинает вращаться.</li>\r\n	<li class=\"margin-list\">С параллельной стороны находится холодная часть турбины, и там установлено компрессорное колесо, когда крыльчатка горячей части начинает раскручиваться тем самым приводят в действие компрессорное колесо, а оно производит так называемый турбонаддув по системе наддува, проходя через патрубки и радиатор интеркулера попадает во впускной коллектор и далее в камеру сгорания создавая в нем необходимое давление.</li>\r\n	<li class=\"margin-list\">Вейсгейт в нужный момент обеспечивает открытия и сброса избыточного давления выхлопных газов, эта функция позволяет выполнить сброс мимо колеса турбины.</li>\r\n</ol>\r\n</div>\r\n<!-- end col-md-3 --></div>\r\n</div>\r\n\r\n<p class=\"p-main text-center mb20\">За частую у актуаторов с вакуумной системой происходит разрыв мембраны, из-за того что заклинила геометрия(сопловой аппарат) или передувная калитка.</p>\r\n\r\n<div class=\"col-md-12\">\r\n<p><strong style=\"color: black\">Если вейсгейт вышел из строя этому будет свидетельствовать ряд признаков:</strong></p>\r\n\r\n<ul class=\"ul-style-2\">\r\n	<li><i class=\"fa fa-times list-icon\"></i>Дребезжания в турбокомпрессоре во время перегазовки и в момент снижения оборотов. (Происходит это потому что шток клапана не зафиксирован, а самое дребезжание издает &quot;калитка&quot; сброса лишнего давления.</li>\r\n	<li><i class=\"fa fa-times list-icon\"></i>Так же если при потере динамики это признак не достаточного наддува.</li>\r\n</ul>\r\n</div>\r\n\r\n<div class=\"col-sm-7\">\r\n<div class=\"row\">\r\n<div class=\"col-md-12\">\r\n<p><strong style=\"color: black\">Естественный износ, и большой пробег и как следствие служит причиной разрыва иногда растягивание мембраны.</strong></p>\r\n\r\n<p><strong style=\"color: black\">В этой ситуации выполняем такие работы:</strong></p>\r\n\r\n<ol class=\"ol-style-4\">\r\n	<li class=\"margin-list\">Актуатор снимаем, разбираем, извлекаем поврежденный манжет(мембрану).</li>\r\n	<li class=\"margin-list\">Обезжириваем поверхность, в клееваем в корпус новую мембрану.</li>\r\n	<li class=\"margin-list\">Делаем за вальцовку корпуса.</li>\r\n	<li class=\"margin-list\">Далее делаем отстройку.</li>\r\n</ol>\r\n</div>\r\n<!-- end col-md-3 --></div>\r\n</div>\r\n\r\n<div class=\"col-sm-5\"><img alt=\"типы актуаторов\" class=\"mb10\" src=\"https://via.placeholder.com/600x300\" width=\"100%\" /></div>\r\n\r\n<div class=\"col-md-12\">\r\n<p class=\"text-center\">Данные работы должный выполнять специалисты, для этого потребуется обладать спец.инструментом и нужными навыки. Турбосервис | TwinTurbo | производит ремонт турбонагнетателей любого производителя и любой сложности.</p>\r\n</div>\r\n</div>',NULL,'2019-10-02 18:08:25');
